import React, { useState } from 'react';
import PropTypes from 'prop-types';
import axios from 'axios';

const AddPage = ({ currentView, handleBackClick }) => {
    const [formData, setFormData] = useState({
        nopol: '',
        merk_mobil: '',
        jenis_tipe_mobil: '',
        model_mobil: '',
        warna_mobil: '',
        warna_tnkb_mobil: '',
        tahun_pembuatan_mobil: '',
        tahun_registrasi_mobil: '',
        ukuran_silinder_mobil: '',
        jenis_bahan_bakar_mobil: '',
        nomor_mesin_mobil: '',
        nomor_rangka_mobil: '',
        nomor_bpkb_mobil: '',
        nomor_stnk_mobil: '',
        masa_berlaku_stnk_mobil: '',
        bobot_mobil: '',
        nomor_kir_mobil: '',
        masa_berlaku_kir_mobil: ''
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('http://localhost:5050/api/mobil/add', formData);
            console.log('Response:', response.data);
            alert('Data mobil berhasil ditambahkan!');
            handleBackClick();
        } catch (error) {
            console.error('Error submitting form:', error);
            alert('Gagal menambahkan data mobil.');
        }
    };

    return (
        <div className="row">
            <div className="col-lg-12">
                <div className="mb-3">
                    <div className="divider text-start">
                    <div className="divider-text">
                        <span className="menu-header-text fs-6">Tambah Data Mobil</span>
                    </div>
                    </div>
                </div>
            </div>
            <div className="col-lg-12">
                <div className="">
                    Klik <button className="fw-bold btn btn-link p-0" onClick={handleBackClick}>disini</button> untuk kembali ke menu utama Mobil.
                </div>
            </div>
            <div className="col-md-12 mt-3">
                <form id="form" onSubmit={handleSubmit}>
                    <div className="row">
                        {/* Tambahkan bagian input form di sini */}
                    </div>
                    <div className="col-md-4 col-sm-12 mt-4">
                        <button type="submit" className="btn btn-primary w-100">Simpan</button>
                    </div>
                </form>
            </div>
        </div>
    );
};

AddPage.propTypes = {
    currentView: PropTypes.string.isRequired,
    handleBackClick: PropTypes.func.isRequired
};

export default AddPage;
